[
  {
    "eng": "From not took",
    "hin": "से नहीं लिया"
  },
  {
    "eng": "Time passed kept on",
    "hin": "समय बीतता रहा"
  },
  {
    "eng": "Cannon up branches till reached went",
    "hin": "बेल ऊपर शाखों तक पहुँच गई"
  },
  {
    "eng": "Cannon's trunk thick being started and truly trunk on tree under stair became",
    "hin": "बेल का तना मोटा होना शुरू हुआ और सचमुच ही पेड़ के तने पर सीढ़ी बन गई"
  },
  {
    "eng": "One day when all herons grain picking outside were, then one hunter upstairs came reached",
    "hin": "एक दिन जब सभी बगुले दाना चुनने बाहर गए हुए थे, तभी एक शिकारी ऊधर आ पहुँचा"
  },
  {
    "eng": "Stair made on tree seeing immediately it tree on climbed net spread and went",
    "hin": "पेड़ पर बनी सीढ़ी को देखते ही उसने पेड़ पर चढ़कर जाल बिछाया और चला गया"
  },
  {
    "eng": "Evening's time when herons returned then net in badly trapped went",
    "hin": "शाम के समय जब बगुले लौटे तो जाल में बुरी तरह फंस गए"
  },
  {
    "eng": "They net in flapping started, then them Tau's cleverness's indication understood",
    "hin": "वे जाल में फड़फड़ाने लगे, तब उन्हें ताऊ की बुद्धिमानी का पता लगा"
  },
  {
    "eng": "Tau mostly angry and silently sitting was",
    "hin": "ताउ सबसे नाराज था और चुप बैठा था"
  },
  {
    "eng": "One heron said Tau, crisis from getting out's method now you only us tell can",
    "hin": "एक बगुले ने कहा, 'ताउ, संकट से निकलने की तरकीब अब आप ही हमें बता सकते हैं!'"
  },
  {
    "eng": "All herons yes in yes agreed",
    "hin": "सभी बगुलों ने हाँ में हाँ मिलाई"
  },
  {
    "eng": "Then Tau them said - morning when hunter comes, then dying act do",
    "hin": "तब ताउ ने उनसे कहा- सुबह जब शिकारी आएगा, तब मरने का नाटक करना"
  },
  {
    "eng": "Hunter you dead thinking net from out taking ground on puts will",
    "hin": "शिकारी तुम्हें मरा हुआ समझकर जाल से निकालकर जमीन पर रखता जाएगा"
  },
  {
    "eng": "There also such only remain and just so he last heron to below keeps",
    "hin": "वहाँ भी ऐसे हीड़े रहना और जैसे ही वह आखिरी बगुले को नीचे रखेगा,"
  },
  {
    "eng": "I whistle blow",
    "hin": "मैं सीटी बजाऊँगा"
  },
  {
    "eng": "Whistle hearing immediately all fly away",
    "hin": "सीटी सुनते ही सब उड़ जाना"
  },
  {
    "eng": "Hunter came then herons did same",
    "hin": "शिकारी आया तो बगुले ने वैसा ही किया"
  },
  {
    "eng": "Like Tau explained was",
    "hin": "जैसा ताउ ने समझाया था"
  },
  {
    "eng": "Truly hunter herons to dead thinking ground on fell went",
    "hin": "सचमुच शिकारी बगुलों को मरा हुआ समझकर जमीन पर पटकता गया"
  },
  {
    "eng": "Then whistle's sound with immediately all herons flew away",
    "hin": "तभी सीटी की आवाज के साथ ही सारे बगुले उड़ गए"
  },
  {
    "eng": "Hunter watching stayed",
    "hin": "शिकारी देखता रह गया"
  },
  {
    "eng": "Oral questions",
    "hin": "मौखिक प्रश्न"
  },
  {
    "eng": "1. Herons where live were?",
    "hin": "1. बगुले कहाँ रहते थे?"
  },
  {
    "eng": "2. Old heron what saw?",
    "hin": "2. बूढ़े बगुले ने क्या देखा?"
  },
  {
    "eng": "3. Cannon up where till reached?",
    "hin": "3. बेल ऊपर कहाँ तक पहुँच गई?"
  },
  {
    "eng": "4. Stair where became?",
    "hin": "4. सीढ़ी कहाँ बन गई?"
  }
]

